    render() {
        return (

          <div className="col-xs-12 col-sm-12 col-md-12 col-lg-12">
          <div className="row">
              <div className="col-xs-6 col-sm-6 col-md-6 col-lg-6">
               <TaskDoingList/>
               </div>
              <div className="col-xs-6 col-sm-6 col-md-6 col-lg-6">
               <TaskFinishList/>
              </div>

          </div>
        </div>

        );
    }
}
const mapStateToProps = (state)=>{
    return {
      user:state.user
    }
  }
